private void closeInternal(T currentProxy) {
  if ((currentProxy != null) && (currentProxy instanceof Closeable)) {
    try {
      ((Closeable) currentProxy).close();
    } catch (IOException e) {
      LOG.warn("Exception while trying to close proxy", e);
    }
  } else {
    RPC.stopProxy(currentProxy);
  }

}
